import React from "react";

interface MarkdownProps {
  markdown: string;
  className: string;
}

export const Markdown = ({ markdown, className }: MarkdownProps) =>
  markdown ? (
    <div className={className} dangerouslySetInnerHTML={{ __html: markdown }} />
  ) : (
    <div />
  );
